import Link from 'next/link';


const Nav = (props) => {

    const { route } = props;
    console.log('route --> ', route);



    return (

        <section className="section__nav">
            <nav>


                <Link href="/">
                    <a>Home</a>
                </Link>
                <Link href="/about">
                    <a>About</a>
                </Link>

                <Link href="/projects">
                    <a>Projects</a>
                </Link>

            </nav>
        </section>

    )
}

export default Nav
